  var options = {
    url: '',
    suggest: 'false'
  }

  function style(css, name) {
    var head = $('head'), el = $('<style />'), found = false
    if (name) {
      head.find('style').each(function(i, s) {
        if ($(s).attr('summon-name') == name) {
          found = true
          return
        }
      })
      if (found) return
    }
    el = document.createElement('style')
    if (name) { el.setAttribute('summon-name', name) }
    if ('styleSheet' in el) { // IE
      head.get(0).appendChild(el)
      el.styleSheet.cssText = css
    } else {
      el = $(el).html(css).appendTo(head)
    }
  }
  
  function parseUrl(url) {
    var a = document.createElement('a')
    a.href = url
    return a
  }
  
  function widgetUrl() {
    var el = $(options.id)
    return parseUrl(el.data('url') ? el.data('url') : el.attr('src'))
  }
  
  function SearchBox(o) {
    o = o || {}
    options = $.extend({}, options, o)
   
    style(css, 'summon-search-form')
   
    //var url = widgetUrl()
   // options.url = url.protocol + '//' + url.host
    if (options.suggest) {
      enableSuggest()
    }
  }
  
  function enableSuggest() {
    $.suggest.suggest.defaults.service_url = options.url
    $(".summon-search-field").suggest({
      type:[
        '/time/event',
        '/event',
        '/base/newsevents/news_reported_event',
        '/base/argumentmaps/morally_disputed_activity',
        '/book/book_subject',
        '/education/field_of_study',
        '/location',
        '/education/academic',
        '/common/topic/subject_of',
        '/medicine',
        '/base/argumentmaps'
      ],
      animate: true,
      type_strict:'should'
    }).bind("fb-select", function(e, data) {
      $(this).parents("form").submit()
	  //SearchOn();
    })
  }
  SummonSearchBox = SearchBox
